import React from "react";
import Input from '@mui/joy/Input';
import Button from '@mui/joy/Button';
import AuthStyle from "../../../../styles/Auth/Auth.css";
import { useNavigate } from "react-router";
import { useDispatch } from "react-redux";
import { fetchRegister } from "../../../../redux/reducers/TypeAuth";
import Select from '@mui/joy/Select';
import Option from '@mui/joy/Option';


const { FormAuth } = AuthStyle


function Regist(props) {
    const { flagCaptcha } = props

    const navigate = useNavigate()
    const dispatch = useDispatch()

    let login = "",
        pass = "",
        secPass = "",
        faculty = ""


    function sendData() {
        let data = {
            login: login,
            pass: pass,
            secPass: secPass
        }
        dispatch(fetchRegister({ data }))
    }


    return (
        <>
            <FormAuth onSubmit={(e) => {
                e.preventDefault();
                e.target.reset();
            }}>
                <Input
                    onChange={(event) => { login = event.target.value }}
                    placeholder="Введите логин"
                    size="md"
                    variant="soft"
                    type="email"
                />
                <Input
                    onChange={(event) => { pass = event.target.value }}
                    type="password"
                    placeholder="Введите пароль"
                    size="md"
                    variant="soft"
                />
                <Input
                    onChange={(event) => { secPass = event.target.value }}
                    type="password"
                    placeholder="Повторите пароль"
                    size="md"
                    variant="soft"
                    required={true}
                />
                <Select required={true} placeholder="Факультет" onChange={(event, newValue) => {faculty = newValue}}>
                    <Option value="ФГИиБ">ФГИиБ</Option>
                    <Option value="ФОП">ФОП</Option>
                    <Option value="КФ">КФ</Option>
                    <Option value="ПГ">ПГ</Option>
                </Select>
                <Select required={true} placeholder="Клубы" onChange={(event, newValue) => {faculty = newValue}}>
                    <Option value="Спортклуб">Спортклуб</Option>
                    <Option value="Вектор">Вектор</Option>
                    <Option value="Турклуб">Турклуб</Option>
                    <Option value="Продакшн">Продакшн</Option>
                </Select>

                <Button type="submit" disabled={!flagCaptcha} onClick={sendData}>Войти</Button>
            </FormAuth >
        </>
    )
}

export default Regist
